INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Normalizaci√≥n', 'data:image/jpeg;base64,', '<p>La normalizaci√≥n en dibujo t√©cnico es el conjunto de reglas y convenciones para estandarizar representaciones gr√°ficas.</p>', 'data:image/png;base64,', '<h1>Normalizaci√≥n en Dibujo T√©cnico</h1>\n    <p>La normalizaci√≥n en dibujo t√©cnico consiste en un conjunto de reglas, convenciones y est√°ndares que se emplean para representar objetos, estructuras o piezas de manera precisa y comprensible en los planos o dibujos t√©cnicos.</p>\n    \n    <h2>Aspectos Clave de la Normalizaci√≥n:</h2>\n    <ol>\n        <li>\n            <strong>Formato y m√°rgenes:</strong> Define las dimensiones del papel, los m√°rgenes y la disposici√≥n del dibujo en la hoja.\n        </li>\n        <li>\n            <strong>L√≠neas y tipos de l√≠neas:</strong> Establece reglas sobre el grosor, longitud y tipo de l√≠neas para representar diferentes elementos en el dibujo.\n        </li>\n        <li>\n            <strong>Escalas:</strong> Determina la relaci√≥n entre las dimensiones reales del objeto y las representadas en el dibujo.\n        </li>\n        <li>\n            <strong>Simbolog√≠a:</strong> Define los s√≠mbolos utilizados para representar caracter√≠sticas espec√≠ficas, como roscas, soldaduras, materiales, etc.\n        </li>\n        <li>\n            <strong>Acotaci√≥n:</strong> Establece normas para indicar las dimensiones del objeto, incluyendo medidas lineales, √°ngulos, tolerancias, entre otros.\n        </li>\n    </ol>\n    \n    <p>La normalizaci√≥n facilita la comunicaci√≥n entre dise√±adores, ingenieros y fabricantes, asegurando la precisi√≥n en la fabricaci√≥n de componentes y estructuras, minimizando errores y garantizando la uniformidad en la producci√≥n.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Generalidades', 'data:image/jpeg;base64,', '<p>El di√©drico en dibujo t√©cnico es un sistema que utiliza proyecciones ortogonales para representar objetos tridimensionales en un plano bidimensional.</p>', 'data:image/png;base64,', '<h1>Sistema Di√©drico: Generalidades</h1>\n    <p>El sistema di√©drico es un m√©todo utilizado en dibujo t√©cnico para representar objetos en un espacio tridimensional mediante proyecciones en un plano bidimensional. Se basa en conceptos fundamentales como el punto, la recta y el plano, los cuales son proyectados sobre planos de proyecci√≥n para crear representaciones en dos dimensiones.</p>\n    \n    <p>En este sistema, se trabaja con la proyecci√≥n ortogonal, donde cada punto del espacio tridimensional tiene tres proyecciones sobre tres planos mutuamente perpendiculares: horizontal (H), vertical (V) y frontal (F).</p>\n    \n    <p>La tercera proyecci√≥n es esencial para obtener una representaci√≥n completa y precisa de un objeto. A partir de las proyecciones sobre los tres planos, se pueden determinar relaciones entre puntos, rectas y planos. Esto incluye la pertenencia de un punto a una recta o a un plano, as√≠ como la determinaci√≥n de la recta que pertenece a un plano dado.</p>\n    \n    <p>El sistema di√©drico tambi√©n aborda la definici√≥n de planos mediante sus proyecciones y permite calcular la intersecci√≥n entre diferentes elementos, como dos rectas, dos planos o la intersecci√≥n entre una recta y un plano. Adem√°s, se exploran las intersecciones con los planos bisectores, que son planos que cortan un objeto por la mitad.</p>\n    \n    <p>En el contexto del sistema di√©drico, se establecen conceptos cruciales como el paralelismo y la perpendicularidad entre l√≠neas, planos o ejes. Estos conceptos se aplican para determinar relaciones espaciales y construir representaciones precisas de objetos tridimensionales en dos dimensiones.</p>\n    \n    <p>Los ejemplos de paralelismo y perpendicularidad ayudan a comprender y aplicar estos principios, mostrando c√≥mo identificar y trabajar con l√≠neas o planos que se comportan de manera paralela o perpendicular en el espacio tridimensional y sus proyecciones en el plano bidimensional.</p>\n', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Los m√©todos operativos', 'data:image/jpeg;base64,', '<p>Los m√©todos operativos en dibujo t√©cnico son procedimientos pr√°cticos para realizar representaciones gr√°ficas precisas y detalladas.</p>', 'data:image/png;base64,', '<h1>Sistema Di√©drico: Los m√©todos operativos</h1>\n    <p>En el sistema di√©drico, el abatimiento implica la representaci√≥n en un plano bidimensional de elementos situados en un plano oblicuo. Se utiliza mediante m√©todos como la cota y la afinidad para representar con precisi√≥n elementos en posiciones no ortogonales.</p>\n    \n    <p>Se realizan ejercicios espec√≠ficos, identificados como 01, 02, 03 y 04, para comprender y aplicar el abatimiento de un plano oblicuo. Adem√°s, se abordan los abatimientos de todos los planos, incluyendo el ejercicio 05 que trata el abatimiento de un plano paralelo a la LT (l√≠nea de tierra).</p>\n    \n    <p>El √°ngulo de trazas de un plano se refiere al √°ngulo formado por las proyecciones del plano sobre los planos de proyecci√≥n (horizontal y vertical). Este √°ngulo es relevante para comprender y trabajar con los cambios de plano, que implican pasar de una proyecci√≥n a otra y realizar giros para obtener diferentes perspectivas de un objeto en el sistema di√©drico.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Distancias', 'data:image/jpeg;base64,', '<p>Las distancias en sistema di√©drico en dibujo t√©cnico representan las mediciones espaciales entre puntos, rectas o planos, esenciales para la precisi√≥n y ubicaci√≥n de elementos en proyecciones.</p>', 'data:image/png;base64,', '<h1><span style=\"font-size: 3.25rem; letter-spacing: -0.04em; background-color: var(--bs-body-bg); font-family: var(--font-global); text-align: var(--bs-body-text-align);\">Sistema Di√©drico</span>: Distancias</h1>\n    <p>El sistema di√©drico no solo trata la representaci√≥n espacial de objetos, sino que tambi√©n permite calcular distintas distancias entre elementos geom√©tricos. Entre estas distancias se encuentran:</p>\n    \n    <ol>\n        <li><strong>Distancia entre dos puntos:</strong> Se calcula mediante la proyecci√≥n de los puntos sobre los planos de proyecci√≥n y la aplicaci√≥n de f√≥rmulas geom√©tricas.</li>\n        \n        <li><strong>Distancia de un punto a un plano:</strong> Se determina la distancia perpendicular desde un punto hacia un plano, utilizando la proyecci√≥n ortogonal.</li>\n        \n        <li><strong>Distancia de un punto a una recta:</strong> Similar al caso anterior, se establece la distancia perpendicular desde un punto a una recta mediante proyecciones.</li>\n        \n        <li><strong>Distancia entre dos planos paralelos:</strong> Al ser paralelos, se utiliza la proyecci√≥n ortogonal para calcular la distancia entre ambos planos.</li>\n        \n        <li><strong>Distancia entre dos rectas paralelas:</strong> Se aplica una proyecci√≥n para calcular la distancia entre dos rectas que son paralelas en el espacio tridimensional.</li>\n        \n        <li><strong>Distancia entre una recta y un plano paralelos:</strong> La distancia entre una recta y un plano paralelo a ella se obtiene mediante proyecciones ortogonales.</li>\n        \n        <li><strong>Distancia entre dos rectas que se cruzan:</strong> Si las rectas se cruzan en el espacio tridimensional, se calcula su distancia aplicando proyecciones y f√≥rmulas espec√≠ficas.</li>\n        \n        <li><strong>Ejercicio 06: Distancia entre dos planos:</strong> Este ejercicio espec√≠fico probablemente involucra la aplicaci√≥n pr√°ctica de las f√≥rmulas y conceptos relacionados con la distancia entre dos planos.</li>\n    </ol>\n    \n    <p>Estos c√°lculos de distancias en el sistema di√©drico son fundamentales para determinar relaciones espaciales precisas entre distintos elementos geom√©tricos en el dibujo t√©cnico.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. √Ångulos.', 'data:image/jpeg;base64,', '<p>Los √°ngulos en sistema di√©drico en dibujo t√©cnico representan las relaciones angulares entre l√≠neas y planos en proyecciones ortogonales.</p>', 'data:image/png;base64,', '<h1>Sistema Di√©drico: √Ångulos</h1>\n  <p>\n    El sistema di√©drico es un m√©todo en geometr√≠a descriptiva que utiliza proyecciones ortogonales en un plano bidimensional, con dos planos de proyecci√≥n: el Plano Horizontal (PHP) y el Plano Vertical (PVP).\n  </p>\n  <p>\n    En resumen, este sistema:\n  </p>\n  <ul>\n    <li>Introduce la representaci√≥n de objetos 3D en un espacio 2D.</li>\n    <li>Calcula √°ngulos de rectas y planos con los planos de proyecci√≥n.</li>\n    <li>Permite dibujar rectas y planos dados sus √°ngulos con PHP y PVP.</li>\n    <li>Aborda conceptos como √°ngulos de trazas de planos, √°ngulos entre rectas, entre planos, y entre rectas y planos dados.</li>\n  </ul>\n  <p>\n    En ingenier√≠a, arquitectura y dise√±o, el sistema di√©drico es esencial para proyectar objetos tridimensionales en planos bidimensionales, facilitando su visualizaci√≥n y an√°lisis.\n  </p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Formas geom√©tricas', 'data:image/jpeg;base64,', '<p>Las formas geom√©tricas en sistema di√©drico son figuras tridimensionales representadas mediante proyecciones ortogonales, empleadas para visualizar y comprender la estructura espacial de objetos en dibujo t√©cnico.</p>', 'data:image/png;base64,', '<h1>Sistema Di√©drico. Formas geom√©tricas</h1>\n\n    <p><strong>Prisma:</strong> Comencemos con el prisma, una figura tridimensional con caras planas que son paralelas y congruentes. En el sistema di√©drico, al representar un prisma, sus aristas se proyectan sobre los planos de proyecci√≥n de acuerdo con su disposici√≥n en el espacio. Las aristas que son perpendiculares al plano de proyecci√≥n se proyectan como puntos. La altura de un prisma apoyado en un plano puede ser visualizada proyectando las aristas que definen esta altura en los planos de proyecci√≥n.</p>\n\n    <p><strong>Cilindro:</strong> Un cilindro es una figura con dos caras circulares y una superficie curva. En el sistema di√©drico, proyectar un cilindro implica representar sus generatrices, las cuales se proyectan como segmentos de recta en los planos de proyecci√≥n. La intersecci√≥n de un cilindro con un plano oblicuo resulta en una elipse en la proyecci√≥n.</p>\n\n    <p><strong>Pir√°mide:</strong> Esta figura tiene una base poligonal y caras triangulares que convergen en un v√©rtice. En el sistema di√©drico, proyectar una pir√°mide implica proyectar sus aristas y v√©rtices de acuerdo con su posici√≥n en el espacio. Al colocar una pir√°mide sobre un plano oblicuo, sus proyecciones en los planos de proyecci√≥n se ven afectadas por la orientaci√≥n y la intersecci√≥n con el plano.</p>\n\n    <p><strong>Cono:</strong> Similar a la pir√°mide, un cono tiene una base circular y una superficie curva que converge en un v√©rtice. En el sistema di√©drico, se proyecta como un conjunto de segmentos de recta y curvas el√≠pticas. Cuando se coloca sobre un plano oblicuo, las proyecciones se ven modificadas por la intersecci√≥n y la orientaci√≥n del cono con respecto al plano.</p>\n\n    <p><strong>Esfera:</strong> La esfera, siendo una figura completamente sim√©trica, se proyecta como una elipse en los planos de proyecci√≥n. Sus proyecciones var√≠an dependiendo de su posici√≥n y orientaci√≥n en el espacio.</p>\n\n    <p><strong>Altura de una figura apoyada en un plano:</strong> La altura de una figura apoyada en un plano se determina proyectando las aristas que definen esta altura en los planos de proyecci√≥n y observando su proyecci√≥n sobre el plano de apoyo.</p>\n\n    <p><strong>Intersecciones de planos con superficies radiadas:</strong> Cuando un plano intersecta superficies como prisma, cilindro, pir√°mide o cono, las proyecciones muestran la intersecci√≥n como l√≠neas y curvas, dependiendo de la forma y orientaci√≥n de la intersecci√≥n.</p>\n\n    <p><strong>Teorema de Salch:</strong> Este teorema establece que la proyecci√≥n de una l√≠nea es una l√≠nea en cada plano de proyecci√≥n, y si una l√≠nea es perpendicular a uno de los planos de proyecci√≥n, su proyecci√≥n en ese plano ser√° un punto.</p>\n\n    <p><strong>Intersecciones de rectas con superficies radiadas:</strong> La intersecci√≥n de rectas con estas superficies se proyecta en los planos de proyecci√≥n como puntos, l√≠neas o curvas, dependiendo de la configuraci√≥n de las l√≠neas y la superficie.</p>\n\n    <p><strong>Ejercicios:</strong> Los ejercicios propuestos, como colocar prisma, pir√°mide, cilindro o cono sobre planos oblicuos, y encontrar intersecciones con planos y rectas, implican proyectar las figuras en los planos de proyecci√≥n y analizar las proyecciones resultantes para determinar las intersecciones y relaciones entre las diferentes figuras y planos.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Desarrollos', 'data:image/jpeg;base64,', '<p>Los desarrollos en sistema di√©drico en dibujo t√©cnico son representaciones planas de formas tridimensionales, mostrando todas sus caras en un mismo plano.</p>', 'data:image/png;base64,', '<h1>Sistema Di√©drico: Desarrollos</h1>\n\n    <p><strong>Desarrollos:</strong> Dentro del sistema di√©drico, los desarrollos implican representar figuras tridimensionales en superficies planas. Esto se logra desplegando las caras de las figuras en un plano, manteniendo la relaci√≥n entre sus elementos y conservando las medidas.</p>\n\n    <p><strong>Transformada:</strong> La transformada en el sistema di√©drico se refiere a proyectar figuras tridimensionales en los planos de proyecci√≥n. Esta proyecci√≥n permite visualizar la figura desde diferentes perspectivas y analizar su representaci√≥n en dos dimensiones.</p>\n\n    <p><strong>L√≠nea geod√©sica:</strong> Una l√≠nea geod√©sica es la trayectoria m√°s corta entre dos puntos en una superficie, siguiendo la curvatura de esa superficie. En el contexto del sistema di√©drico, el estudio de l√≠neas geod√©sicas puede ser relevante al analizar la proyecci√≥n de l√≠neas sobre superficies curvas o en el desarrollo de figuras en diferentes planos.</p>\n\n    <p><strong>Desarrollo de prisma recto y cilindro recto:</strong> El desarrollo de un prisma recto implica desplegar las caras laterales y la base del prisma en un plano, manteniendo sus proporciones y relaciones. De manera similar, el desarrollo de un cilindro recto requiere representar la superficie curva y las bases circulares en un plano.</p>\n\n    <p><strong>Desarrollo de prisma y cilindro oblicuo:</strong> Cuando se trata de un prisma o cilindro oblicuo, su desarrollo implica representar las caras y superficies inclinadas en un plano, considerando la inclinaci√≥n y las intersecciones con dicho plano.</p>\n\n    <p><strong>Desarrollo de pir√°mide recta y oblicua:</strong> En el caso de una pir√°mide recta, el desarrollo implica desplegar las caras triangulares y la base en un plano, manteniendo sus proporciones. Una pir√°mide oblicua requerir√° representar las caras inclinadas en el desarrollo.</p>\n\n    <p><strong>Desarrollo de cono recto y oblicuo:</strong> El desarrollo de un cono recto implica representar la superficie curva y la base circular en un plano, manteniendo sus proporciones. Para un cono oblicuo, se debe considerar la inclinaci√≥n de la superficie en el desarrollo.</p>\n\n    <p><strong>Desarrollo de poliedros regulares:</strong> Los poliedros regulares, como el tetraedro, el cubo, el octaedro, el dodecaedro y el icosaedro, tienen desarrollos espec√≠ficos que implican desplegar sus caras planas en un plano manteniendo las relaciones entre sus elementos y respetando sus √°ngulos y proporciones.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Perspectiva Axonom√©trica ortogonal y oblicua', 'data:image/png;base64,', '<p>La perspectiva axonom√©trica ortogonal y oblicua en dibujo t√©cnico es un m√©todo de representaci√≥n tridimensional que muestra objetos con √°ngulos y dimensiones precisas desde diferentes vistas sin distorsi√≥n de escala.</p>', 'data:image/png;base64,', '<h1>Perspectiva Axonom√©trica ortogonal y oblicua</h1>\n\n    <p><strong>Axonometr√≠a: Isom√©trica y Caballera:</strong> La axonometr√≠a es un sistema de representaci√≥n gr√°fica tridimensional que permite proyectar objetos en un plano bidimensional manteniendo proporciones y √°ngulos. En este contexto, se destacan dos tipos principales: la isom√©trica y la caballera. La isom√©trica proyecta los ejes con la misma escala, mientras que la caballera no sigue esta regla, permitiendo una representaci√≥n m√°s realista de la profundidad.</p>\n\n    <p><strong>Ejercicio 01:</strong> Vistas y acotaci√≥n. Perspectiva isom√©trica.</p>\n\n    <p><strong>Ejercicio 02:</strong> Perspectiva Isom√©trica.</p>\n\n    <p><strong>Ejercicio 03:</strong> Perspectiva caballera.</p>\n\n    <p><strong>Introducci√≥n al sistema axonom√©trico:</strong> La axonometr√≠a es un m√©todo de representaci√≥n gr√°fica que permite proyectar objetos tridimensionales en un plano bidimensional de manera proporcional. En este contexto, se exploran conceptos fundamentales como la reducci√≥n de ejes, la pertenencia de puntos, rectas y planos, as√≠ como la intersecci√≥n, paralelismo y abatimiento de planos en diferentes sistemas axonom√©tricos.</p>\n\n    <p><strong>Perspectiva caballera en funci√≥n del √°ngulo del eje Y:</strong> En la representaci√≥n caballera, el √°ngulo del eje Y determina la inclinaci√≥n de los ejes, lo que influye en la perspectiva y la apariencia de los objetos proyectados.</p>\n\n    <p><strong>Reducci√≥n de los ejes en axonom√©trico:</strong> La reducci√≥n de ejes es una t√©cnica que permite representar objetos tridimensionales en un espacio bidimensional manteniendo sus proporciones y dimensiones relativas.</p>\n\n    <p><strong>Punto, recta y plano. Pertenencia:</strong> En el contexto axonom√©trico, se analiza la ubicaci√≥n de puntos, rectas y planos en relaci√≥n con los ejes y la representaci√≥n gr√°fica, considerando su pertenencia y posici√≥n.</p>\n\n    <p><strong>Intersecciones. Traza ordinaria:</strong> Se estudia c√≥mo se intersecan los elementos geom√©tricos en el sistema axonom√©trico, representando sus proyecciones y trayectorias en la proyecci√≥n bidimensional.</p>\n\n    <p><strong>Paralelismo:</strong> La noci√≥n de paralelismo en el sistema axonom√©trico se refiere a l√≠neas o planos que mantienen la misma direcci√≥n o son equidistantes en el espacio proyectado.</p>\n\n    <p><strong>Abatimiento de los planos de proyecci√≥n en trim√©trico:</strong> El abatimiento de los planos de proyecci√≥n en el sistema trim√©trico implica representar los planos desde un √°ngulo espec√≠fico para obtener una proyecci√≥n m√°s realista.</p>\n\n    <p><strong>Abatimiento de los planos de proyecci√≥n en caballera:</strong> Similar al sistema trim√©trico, en la perspectiva caballera se abaten los planos de proyecci√≥n para lograr una representaci√≥n tridimensional ajustada a la realidad.</p>\n\n    <p><strong>Abatimiento de un plano oblicuo en trim√©trico:</strong> Este proceso implica abatir un plano que no es perpendicular a los ejes de proyecci√≥n en el sistema trim√©trico, ajustando su representaci√≥n en el plano bidimensional.</p>\n\n    <p><strong>Abatimiento de un plano oblicuo en caballera:</strong> Similar al caso anterior, se abate un plano que no es paralelo a los ejes de proyecci√≥n en la perspectiva caballera, logrando representarlo de manera m√°s cercana a la realidad.</p>\n\n    <p><strong>Perpendicularidad:</strong> En el contexto axonom√©trico, se estudia la relaci√≥n entre l√≠neas o planos que se cruzan formando √°ngulos de 90 grados, lo que indica perpendicularidad.</p>\n\n    <p><strong>La esfera en sistema axonom√©trico:</strong> La representaci√≥n de la esfera en un sistema axonom√©trico implica proyectarla de manera adecuada en un plano bidimensional, considerando su forma tridimensional y su posici√≥n en el espacio.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Planos Acotados', 'data:image/jpeg;base64,', '<p>Los planos acotados en dibujo t√©cnico son representaciones gr√°ficas detalladas de un objeto o estructura, con dimensiones y especificaciones t√©cnicas.</p>', 'data:image/png;base64,', '<h1>Planos Acotados</h1>\n\n    <p><strong>Introducci√≥n - Punto, recta y plano:</strong> Comenzamos con los elementos b√°sicos en geometr√≠a: el punto, que representa una ubicaci√≥n en el espacio, la recta, que se extiende en una direcci√≥n infinita, y el plano, una superficie plana e infinita formada por rectas. En el contexto de los planos acotados, estos elementos son fundamentales para establecer referencias y dimensiones.</p>\n\n    <p><strong>Pertenencia:</strong> La noci√≥n de pertenencia es crucial en los planos acotados, ya que se refiere a la ubicaci√≥n de puntos, rectas o figuras dentro de un plano o espacio definido. Determinar la pertenencia es esencial para situar objetos y establecer relaciones en los dibujos t√©cnicos.</p>\n\n    <p><strong>Intersecciones:</strong> Cuando diferentes elementos como rectas, planos o figuras se cruzan, sus intersecciones son puntos o l√≠neas que indican c√≥mo se relacionan en el espacio. En los planos acotados, representar estas intersecciones con precisi√≥n es vital para comprender la disposici√≥n y la relaci√≥n entre diferentes elementos.</p>\n\n    <p><strong>Abatimientos:</strong> Los abatimientos son t√©cnicas utilizadas en dibujo t√©cnico para representar objetos tridimensionales en un plano bidimensional. Estas proyecciones permiten visualizar c√≥mo se ver√≠an los objetos desde diferentes √°ngulos y perspectivas.</p>\n\n    <p><strong>Trazado de cubiertas - Aleros exteriores:</strong> Al trazar cubiertas en los planos acotados, se debe representar con precisi√≥n la disposici√≥n de los aleros exteriores. Estos detalles son cruciales en arquitectura y construcci√≥n para planificar la protecci√≥n de las estructuras y garantizar un dise√±o funcional.</p>\n\n    <p><strong>Cubiertas: Alzados y secciones:</strong> Representar las cubiertas en alzados (vistas frontales) y secciones (vistas transversales) en los planos acotados es esencial para mostrar la disposici√≥n y los detalles de techos y estructuras relacionadas.</p>\n\n    <p><strong>Cubiertas con patios interiores:</strong> Las cubiertas que incluyen patios interiores requieren un enfoque especial en los planos acotados para representar la disposici√≥n espacial y la relaci√≥n entre las √°reas cubiertas y descubiertas dentro de un edificio.</p>\n\n    <p><strong>Dibujo topogr√°fico. Generalidades:</strong> El dibujo topogr√°fico se enfoca en representar las caracter√≠sticas del terreno en un plano. En los planos acotados, se incluyen detalles topogr√°ficos clave como curvas de nivel, pendientes y elevaciones.</p>\n\n    <p><strong>Dibujo topogr√°fico. Plataformas con curvas:</strong> Las plataformas con curvas, que representan √°reas elevadas o niveladas en el terreno, requieren una representaci√≥n precisa en los planos acotados para mostrar su disposici√≥n y relaci√≥n con otras caracter√≠sticas topogr√°ficas.</p>\n\n    <p><strong>Acuerdos c√≥nicos y cil√≠ndricos:</strong> Los acuerdos c√≥nicos y cil√≠ndricos son representaciones en los planos acotados que muestran c√≥mo se ver√≠an objetos tridimensionales cuando se proyectan en un plano.</p>\n\n    <p><strong>Ejercicio de explanaciones:</strong> Este ejercicio implica representar gr√°ficamente explanaciones, es decir, √°reas excavadas o rellenadas en el terreno, utilizando t√©cnicas precisas en los planos acotados para mostrar su disposici√≥n y relaci√≥n con el entorno.</p>', 'data:image/png;base64,');
INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Geometr√≠a plana', 'data:image/jpeg;base64,', '<p>La geometr√≠a plana en dibujo t√©cnico se refiere al estudio y representaci√≥n de figuras y formas bidimensionales en un plano, aplicando principios geom√©tricos para su representaci√≥n gr√°fica.</p>', 'data:image/png;base64,', '<h1>Geometr√≠a plana</h1>\n\n    <p><strong>Tri√°ngulos: Nomenclatura y clasificaci√≥n:</strong> Los tri√°ngulos se clasifican seg√∫n la medida de sus √°ngulos y lados. La nomenclatura est√° basada en la longitud de sus lados (equil√°tero, is√≥sceles, escaleno) y en la medida de sus √°ngulos (rect√°ngulo, obtus√°ngulo, acut√°ngulo). Cada clasificaci√≥n lleva consigo propiedades espec√≠ficas que definen sus caracter√≠sticas geom√©tricas y matem√°ticas.</p>\n\n    <p><strong>Tri√°ngulos: Puntos y rectas notables:</strong> Los tri√°ngulos tienen puntos y rectas notables que son fundamentales en geometr√≠a. Algunos de estos son el baricentro, ortocentro, circuncentro e incentro, as√≠ como las medianas, alturas, bisectrices y medianas de un tri√°ngulo. Estos puntos y rectas tienen propiedades particulares que los hacen relevantes en diversas configuraciones geom√©tricas y c√°lculos matem√°ticos.</p>\n\n    <p><strong>Pol√≠gonos regulares:</strong> Los pol√≠gonos regulares son figuras con lados iguales y √°ngulos congruentes. Se caracterizan por tener todas sus aristas y √°ngulos internos id√©nticos. Ejemplos comunes son el cuadrado, el pent√°gono, el hex√°gono, el hept√°gono y el oct√≥gono regulares.</p>\n\n    <p><strong>Pol√≠gonos regulares dado el lado:</strong> Es posible calcular propiedades geom√©tricas de pol√≠gonos regulares dados sus lados. Esto incluye el c√°lculo del per√≠metro, el √°rea, los √°ngulos internos y las diagonales de estos pol√≠gonos.</p>\n\n    <p><strong>Pol√≠gonos regulares dada la circunferencia circunscrita:</strong> La circunferencia circunscrita a un pol√≠gono regular permite relacionar sus lados con el radio de esta circunferencia, lo que facilita c√°lculos relacionados con el pol√≠gono, como el √°rea, el per√≠metro y las propiedades de sus √°ngulos.</p>\n\n    <p><strong>Curvas c√≥nicas: Elipse, par√°bola e hip√©rbola:</strong> Las curvas c√≥nicas son secciones planas que surgen al cortar un cono con un plano en diferentes √°ngulos. La elipse se forma con un corte que no es perpendicular al eje del cono, la par√°bola con un corte paralelo a uno de los generatrices y la hip√©rbola con un corte inclinado. Cada una tiene propiedades √∫nicas y aplicaciones en geometr√≠a y f√≠sica.</p>\n\n    <p><strong>Elipse, Par√°bola, Hip√©rbola: Teor√≠a y ejercicios:</strong> Cada una de estas curvas c√≥nicas tiene una teor√≠a que describe su formaci√≥n, propiedades geom√©tricas y ecuaciones matem√°ticas asociadas. Los ejercicios pr√°cticos ayudan a comprender mejor sus caracter√≠sticas y aplicaciones en problemas geom√©tricos y f√≠sicos.</p>\n\n    <p><strong>Tangencias: Lugares geom√©tricos:</strong> Las tangencias definen lugares geom√©tricos donde l√≠neas, circunferencias o curvas se tocan sin cruzarse. Estos lugares geom√©tricos pueden variar dependiendo de las figuras involucradas y tienen aplicaciones en construcciones geom√©tricas y c√°lculos matem√°ticos.</p>\n\n    <p><strong>Potencia, eje radical y centro radical:</strong> Estos conceptos est√°n relacionados con las intersecciones de c√≠rculos y l√≠neas. La potencia de un punto con respecto a una circunferencia, el eje radical de dos circunferencias y el centro radical de tres circunferencias tienen aplicaciones en la teor√≠a de intersecciones y construcciones geom√©tricas.</p>\n\n    <p><strong>Inversi√≥n: Punto, recta y circunferencia:</strong> La inversi√≥n es una transformaci√≥n geom√©trica que intercambia puntos en funci√≥n de una circunferencia dada como \"c√≠rculo de inversi√≥n\". Los puntos en el exterior de la circunferencia se convierten en puntos en el interior y viceversa. Esta t√©cnica se aplica en geometr√≠a anal√≠tica y resoluci√≥n de problemas geom√©tricos.</p>\n\n    <p><strong>Tangencias: Los 10 problemas de Apolonio:</strong> Los problemas de Apolonio, relacionados con las tangencias, son diez problemas geom√©tricos cl√°sicos que involucran situaciones espec√≠ficas de tangencias entre c√≠rculos y l√≠neas rectas. Resolver estos problemas requiere comprender las propiedades de las tangencias y aplicar estrategias geom√©tricas avanzadas.</p>', 'data:image/png;base64,');
